import React from 'react';
import TokenService from '../../../services/TokenService';
import {format as formatDate} from 'date-fns'

export default class ServiceHistory extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            services: []
        }
    }

    componentDidMount(){
        fetch('http://localhost:8000/user/service', {
            method: 'GET',
            headers: {
                'authorization': `bearer ${TokenService.getAuthToken()}`
            }
        })
            .then( res => res.json())
            .then( resData => this.setState({services: resData.services}));
    }

   
    render(){
        
        return(
            <section>
                <ul>
                    {this.state.services.map( service => <li key={service.id}><header>{format(service.date_created, 'Do MM YYY')}</header></li>)}
                </ul>
            </section>
        )
    }
}
